text:
뉴진스~.ᐟ..절대 지면안돼.ᐟ
뉴진스 곁엔 항상 버니즈가 있으니까❤뉴진스 해채 안할줄알았는데..
이런날이 와버렸네.ᐟ.ᐟ😢
우니 뉴진스만 안힘들다면 버니즈들은 상관없어💕나는(저는)나이가 어리지만..반말을 할만큼 뉴진스와 친근하고 아끼고 사랑해❤️‍🔥뉴진스는 항상 내가 힘들때마다 도와주는 최고의 천사토끼니까.;악마랑 천사랑 싸우면 천사가 이기지롱❤우리 뉴진스~.ᐟ 화이팅하고 힘내❤@민지언니💕
민지언니 그동안 맴버들 지켜주고 도와줘서 뉴진스가 여기까지 온거같다고 버니즈는 생각해.ᐟ 고마워❤
@하니언니
하니언니..ᐟ 용기내서 뉴스나와줘서 고마웡ㅋㅎㅠ뉴진스 꼭 이기자.ᐟ 화이팅❤
@해린언니
언니❤항상 고양이같은 눈매로 이쁜외모 보여줘서 고͈̮마͈̮워͈̮❤❤알랴뷰❤
@혜인언니
히힣💓언니도 어린데 이렇게 힘든 순간이 찾아와도 잘 참고 견디는 모습이 보기좋아❤사랑행🩵
@다니언니
갸하핳😊다니언니💕언니 항상 밝은모습 보여주고 열심히 버텨줘서 고͈̮마͈̮워͈̮❤
@뉴진스🫶🏻
뉴진스.ᐟ 뉴진스 곁에는 버니즈가 항상있다는것을 까먹지마❤버니즈는 항상 뉴진스편.ᐟ 버니즈는 항상 뉴진스 바라기💞
뉴진스가 진짜 단체로 봐주면 좋겠다..✨
